// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;

contract kipubank {

mapping(address => uint256) public balances;

uint256 public immutable WITHDRAWAL_THRESHOLD;

uint256 public depositoCounts;
uint256 public retiroCounts;
// Evento para notificar el deposito
event Deposit(address indexed user, uint256 amount);

// Evento para notificar el retiro de ETH
event Withdraw(address indexed user, uint256 amount);

    error AmountZero(); // Cuando una cantidad es 0 (para depósito o retiro)
    error InsufficientBalance(address user, uint256 requestedAmount, uint256 currentBalance); // Fondos insuficientes
    error WithdrawalExceedsThreshold(uint256 requestedAmount, uint256 maxAllowed); // Retiro excede el umbral
    error TransferFailed(address recipient, uint256 amount); // Fallo al enviar Ether
    error ThresholdMustBePositive(uint256 providedThreshold); // Umbral de constructor <= 0

    modifier nonZeroValue() {
        if (msg.value == 0) {
            revert AmountZero();
        }
        _;
    }
    modifier nonZeroAmount(uint256 _amount) {
        if (_amount == 0) {
            revert AmountZero();
        }
        _;
    }
    modifier hasSufficientBalance(uint256 _amount) {
        if (balances[msg.sender] < _amount) {
            revert InsufficientBalance(msg.sender, _amount, balances[msg.sender]);
        }
        _;
    }
    modifier notExceedingThreshold(uint256 _amount) {
        if (_amount > WITHDRAWAL_THRESHOLD) {
            revert WithdrawalExceedsThreshold(_amount, WITHDRAWAL_THRESHOLD);
        }
        _;
    }


    constructor(uint256 _withdrawalThreshold) {
        if (_withdrawalThreshold == 0) { 
            revert ThresholdMustBePositive(_withdrawalThreshold);
        }
        WITHDRAWAL_THRESHOLD = _withdrawalThreshold;
    }


    function deposit() public payable nonZeroValue{

        // Añade el ETH recibido al balance del remitente.
        balances[msg.sender] += msg.value;
        updateCounts(false);
        // Emite el evento de depósito.
        emit Deposit(msg.sender, msg.value);
    }

    function withdraw(uint256 amount)
        public
        nonZeroAmount(amount)        // Asegura que amount > 0
        hasSufficientBalance(amount) // Asegura que tenga saldo suficiente
        notExceedingThreshold(amount) // Asegura que no exceda el umbral
    {

        // Reduce el balance del usuario.
        balances[msg.sender] -= amount;

        // Transfiere el ETH al usuario.
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        if (!success) { // Usamos if y revert para el error personalizado
            revert TransferFailed(msg.sender, amount);
        }
        updateCounts(true);
        // Emite el evento de retiro.
        emit Withdraw(msg.sender, amount);
    }

     function updateCounts(bool _action) private {
        if(_action){
            retiroCounts++;
        }else  {    
            depositoCounts++;
        }
     }


}

